import React from 'react';
import './registration.css';

const RegistrationTable = ({ data = [] }) => {
  return (
    <div className="table-container">
      <h2>Registration Data</h2>
      {data.length > 0 ? (
        <table>
          <thead>
            <tr>
              <th>Room</th>
              <th>Sector</th>
              <th>Fee</th>
              <th>Food Choice</th>
              <th>Stay From</th>
              <th>Duration</th>
              <th>Name</th>
              <th>Gender</th>
              <th>Email</th>
              {/* Add more columns as needed */}
            </tr>
          </thead>
          <tbody>
            {data.map((item, index) => (
              <tr key={index}>
                <td>{item.room}</td>
                <td>{item.sector}</td>
                <td>{item.feePerMonth}</td>
                <td>{item.foodChoice}</td>
                <td>{item.stayFrom}</td>
                <td>{item.duration}</td>
                <td>{item.firstName} {item.middleName} {item.lastName}</td>
                <td>{item.gender}</td>
                <td>{item.email}</td>
                {/* Add more fields as needed */}
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No registration data available.</p>
      )}
    </div>
  );
};

export default RegistrationTable;
